import React from 'react'
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import * as API from './../../api'
pdfMake.vfs = pdfFonts.pdfMake.vfs;
pdfMake.fonts = {
  THSarabunNew: {
    normal: 'THSarabunNew.ttf',
    bold: 'THSarabunNew Bold.ttf',
    italics: 'THSarabunNew Italic.ttf',
    bolditalics: 'THSarabunNew BoldItalic.ttf'
  },
  Roboto: {
    normal: 'Roboto-Regular.ttf',
    bold: 'Roboto-Medium.ttf',
    italics: 'Roboto-Italic.ttf',
    bolditalics: 'Roboto-MediumItalic.ttf'
  }
}

import Button from '@material-ui/core/Button';

export default function PrintPDF(props){
  const { data, userscore, matchClass, sess, sortBy } = props
  const userData = userscore.filter((d)=>{
    return d.classno === matchClass.classno
  })

  return(
    <Button onClick={()=>handleDownload(data, userData, matchClass, sortBy, sess)} color="primary">
      PDF
    </Button>
  );
}

function handlePrint(data, userscore, classname, sess){
  pdfMake.createPdf(PDFFile(data, userscore, classname)).open()
}

function handleDownload(data, userscore, matchClass, sortBy, sess){
  var matchClassName = data.scorematch === 1 ? matchClass.classname : API.handleAmateurClass(matchClass.classno)
  pdfMake.createPdf(PDFFile(data, userscore, matchClassName, sortBy, sess)).download('Score ' + matchClassName + '.pdf');
}

function PDFFile(data, userscore, classname, sortBy, sess){
  let temp = []
  let tempArr = [1,2,3,4,5,6,7,8,9]
  let tempArr2 = [10,11,12,13,14,15,16,17,18]
  let obj1 = {
    style: 'table',
    table: {
      widths: [
        50, '*', '*'
      ],
      body: [
        [
          {
            text: '',
          },
          {
            text: ( sess && sess.language === 'EN' ) ? "PAR Score" : 'คะแนนสนาม'
          },
          {
            border: [false, false, false, false],
            text: ''
          }
        ]
      ]
    }
  }
  let obj2 = {
    style: 'table',
    margin: [0, 0, 0, 20],
    table: {
      widths: [
        25, 25, 25, 25, 25, 25, 25, 25, 25, 30,
        25, 25, 25, 25, 25, 25, 25, 25, 25, 30, 30, 40
      ],
      body: [
        [ ...data.fieldscore.slice(0, 9),
          {text: handleSumArr(data.fieldscore.slice(0, 9)), fillColor: '#e0e0e0'},
          ...data.fieldscore.slice(9, 18),
          {text: handleSumArr(data.fieldscore.slice(9, 18)), fillColor: '#e0e0e0'},
          {text: handleSumArr(data.fieldscore), fillColor: '#e0e0e0'},
          {
            border: [false, false, false, false],
            text: ''
          }
        ],
      ]
    }
  }
  temp.push({
		columns: [
      {
        image: [
              'data:image/jpeg;base64,'
            ],
        width: 140,
        height: 140,
        margin: [0, 0, 0, 25],
      },
			{
				width: '*',
        margin: [24, 0, 0, 0],
				text: [
          {text: data.title + '\n', fontSize: 36},
          {text: data.date, fontSize: 20},
          {text: `\t${( sess && sess.language === 'EN' ) ? "at" : 'ณ สนาม'}\t`, fontSize: 28},
          {text: data.location, fontSize: 24},
          {text: `\t${( sess && sess.language === 'EN' ) ? "Class" : 'ประเภท'}\t` + classname, fontSize: 28, bold: true},
        ]
			},
		]
	})
  temp.push(obj1)
  temp.push(obj2)
  for(var i = 0;i < userscore.length;i++){
    temp.push({
      style: 'table',
      table: {
        widths: [
          50, '*', '*'
        ],
        body: [
          [
            {
              text: userscore[i].rank, fillColor: '#bdbdbd',
            },
            {
              text: userscore[i].firstname + '\t' + userscore[i].lastname,
              fontSize: 24
            },
            {
              border: [false, false, false, false],
              text: ''
            }
          ]
        ]
      }
    })
    temp.push({
      style: 'table',
      margin: [0, 0, 0, 20],
      pageBreak:
      (i === 2) ? 'after' :
      ( (i + 3) % 5 === 0) ? 'after': null
      ,
      table: {
        widths: [
          25, 25, 25, 25, 25, 25, 25, 25, 25, 30,
          25, 25, 25, 25, 25, 25, 25, 25, 25, 30, 30, 40
        ],
        body: [
          [
            ...userscore[i].score.slice(0, 9),
            {text: userscore[i].out, fillColor: '#e0e0e0'},
            ...userscore[i].score.slice(9, 18),
            {text: userscore[i].in, fillColor: '#e0e0e0'},
            {text: (userscore[i].out + userscore[i].in), fillColor: '#e0e0e0'},
            {text: userscore[i].par, fillColor: '#9e9e9e'}
          ],
        ]
      }
    })
  }

  var doc = {
    pageSize: 'A4',
    pageOrientation: 'landscape',
    margin: [0, 20, 0, 20],
    content: temp,
    styles: {
  		table: {
  			alignment: 'center',
        fontSize: 20,
        bold: true,
  		},
  	},
    defaultStyle: {
      font: 'THSarabunNew'
    }
  };
  return doc
}

function handleSumArr(arr){
  let tempSum = 0;
  for(var i = 0;i < arr.length;i++){
    tempSum += arr[i]
  }
  return tempSum
}
